        if (this._customTires === undefined) {
            this._customTires = false;
        }

        // Convert string to number
        if (Number(type) >= 17 && Number(type) <= 22) {
            ToggleVehicleMod(this.id, Number(type), Boolean(index));
            this._mod[Number(type)] = Boolean(index);
