function Enum(values) {
    if (values instanceof Array) {
        let object = {};
        let index = 0;
        values.forEach(element => {
            object[element] = index;
            index++;
        });
        return Object.freeze(object);
    } else {
        let object = values;
        for (let [k, v] of Object.entries(value)) {
            object[v] = k;
        }
        return Object.freeze(object);
    }
}

